top.WebSocket.prototype.send = function(args) {
    if (this.url.includes(".modd.io/socket.io/?EIO=4&transport=websocket")) {
        if (typeof(args) == "string") {
            if (args.startsWith('42["send chat message"')) {
                var jsonargs = JSON.parse(args.substring(2));
                var msg = jsonargs[1].message;
                jsonargs[1].message = jsonargs[1].message.replace(
                    RegExp("\\:(" + Object.keys(defaults).join("|").replace(/[.*+?^${}()[\]\\]/g, '\\$&') + ")\\:", "gim"),
                    (_, t) => defaults[t]
                );
                args = "42" + JSON.stringify(jsonargs);
            }
        }

    }
    return originalSend2.call(this, args);
}